import Button from "../components/Button";

const Test = () => {
    return (
        <div>
            <selection>
                <Button text="1"/>
                <Button text="2"/>
                <Button text="3"/>
                <Button text="4"/>
                <Button text="5"/>
            </selection>
        </div>
    )
}

export default Test;
